  return (
    <BrowserRouter>
      <Routes>
        <Route path="/" element={<LoginPage />} />
        <Route path="manager" element={<ManagerPage />} />
        <Route path="selectRoom" element={<SelectRoom />} />

      </Routes>
    </BrowserRouter>
  );
}
